import React from 'react'
import { Navbar } from '../components/Navbar'
import { Box, Container, } from '@mui/material'
import { Checkbox } from '@mui/joy'

export default function sepetim() {
  return (
    <div>
      <Navbar />
      <Container
        marginTop={50}
        mt={10}
        component="span" style={{ marginTop: 100, border: '1px solid black ', borderRadius: 5, width: "1000px", height: "200px", marginLeft: 100 }}>
        <Box sx={{ borderBottom: "1px solid black ", height: "50px", width: "998px", marginInline: -3 }}>
        <Checkbox color="primary" label="satıcı adı" />

        </Box>
      </Container>
    </div>
  )
}
